import React, { Component } from "react";
import CartTable from "../components/CartTable";
class CartPage extends Component {
  componentDidMount() {
    this.props.onHashChange(this.props.location.pathname);
  }
  render() {
    return (
      <React.Fragment>
        <CartTable />
      </React.Fragment>
    );
  }
}

export default CartPage;
